import '../styles/App.scss';
import {Routes, Route} from 'react-router-dom';
import { useEffect, useState} from 'react';
import Login from './Login';
import Landing from './Landing';

function App() {
  // VARIABLES ESTADO
  const [section, setSection] = useState('rec-prism');

  // USEEFFECT ?

  // FUNCIONES HANDLER
  const handleSection = (ev)=>{
    setSection(ev);
  }

  // FUNCIONES Y VARIABLES QUE AYUDEN A RENDERIZAR HTML

  // HTML EN EL RETURN

  return (
    <div className="App">
        <main>
          <Routes>
            <Route
              path='/'
              element= {
                <Landing/>
              }
            />
            <Route
              path='/login'
              element= {
                <Login
                  section={section}
                  handleSection={handleSection}
                />
              }
            />
          </Routes>
        </main>
        <footer className='footer'>
        <p>E-schedule</p>
        <p>&copy;Virginia Álvarez Aragón</p>
      </footer>
    </div>
  );
}

export default App;
